var tipuesearch = {"pages": [{'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'w1', 'text': '選擇製圖軟體來畫出圖形並且記錄體積,我們這組使用solidworks和inventer製作 \n \n \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2', 'text': '開學第2週筆記 \n \n \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '第三週 中秋烤肉放假 ! \n \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w4', 'text': 'WINK3 \n \n WINK錄製 \n \n WINK儲存專案 \n \n', 'tags': '', 'url': 'w4.html'}, {'title': 'w5', 'text': '什麼是API \n 在電腦程式設計中, 它屬於應用程式介面 是人類和【機械-物品-軟體】之間溝通的橋樑 \n 舉例:我想使用手機開啟Youtube觀看影片 \n \xa0 \xa0 指令:讓手機開啟youtube執行我所需要的事件 \n \xa0 \xa0 介面:手機螢幕 \n \n', 'tags': '', 'url': 'w5.html'}, {'title': 'w6', 'text': '如何使用API控制solidworks與inventor繪製模型，並同時將各模型之體積與圖片匯入html檔，使其能在網頁中瀏覽各模型變化。 \n \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '利用SciTE編輯器類解譯ANSI C程式並建立C環境 \n 下載cad2020_w7_tcc_gnuplot.7z解壓縮至隨身碟資料夾 \n \n 將gnuplot,tcc資料夾way-microhei.ttc文字檔剪下至data資料夾與tmp同層 \n \n \n 將start.bat丟入小白框修改(新增)紅框內之路徑 \n \n 使用下載的cad2020_w7_tcc_gnuplot.7z裡的wscite資料夾將cpp.properties批次檔案複製出 \n \n 將下載的cpp.properties覆蓋至cad2020資料夾內部原有的cpp.properties批次檔 \n \n 之後即可執行以下程式 \n \n \n \n \n \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '下載 Pyslvs_UI \xa0 ，用參數繪製圖檔 \n Pyslvs 使用手冊 \n Pyslvs連桿機構應用 \n \n \n', 'tags': '', 'url': 'w8.html'}]};